import React,{ Component } from 'react';
class Form1 extends Component
{
    constructor(props)
    {
        super(props)
        this.handleSubmit=this.handleSubmit.bind(this)
        this.handleChange=this.handleChange.bind(this)
        this.state={
              employeeForm:{
                  firstname:'',
                  username:'',
                  password:'',
              }
        }
    }

    handleSubmit()
    {
       var data={firstname:this.state.firstName,username:this.state.username,password:this.state.password}
       //axios.post('http://localhost:8080/api/insertstudent', person);
       console.log(data);
    }
    handleChange()
    {
        this.setState({
            employeeForm:this.state.employeeForm
        })
    }

    render(){
        return(
            <div>
             <form onSubmit={this.handleSubmit} method="post">
                 <input type="text" name="firstname" value={this.state.employeeForm['firstName']}
                               onChange={this.handleChange} id="firstName"/>
                   <br/><br/>   
                 <input type="text" name="username" value={this.state.employeeForm['username']}
                                id="username"/>
                    <br/><br/> 
                 <input type="text" name="password" value={this.state.employeeForm['password']}
                               onChange={this.handleChange} id="password"/>

                    <br/><br/>
                    <button type="submit">submit</button>           
                 </form>
            </div>
        )
    }

}
export default Form1
